commits.content:
export default component$(() => {
  useVisibleTask$(() => {
    startPixi("#app");
  });

  return (
    <main class="bg-dark">
      <Players></Players>
      <h1 class="fw100 animate-fade-in-down">PIXI.js</h1>
      <div id="app" class="ma border border-dotted w-500px h-500px"></div>
    </main>
  );
});
